onGet:
if (query.title === "$FAIL2") {
    var x = null;
    x.fail();
}

if (query.title === "$TESTFAIL2") {
    dpd.todos.get({title: "$FAIL2"}, function(todo, err) {
        this.todo = todo;
        this.err = err;
    });
}

if (query.arbitrary) {
    this.custom = 'arbitrary';
}

onPost:
if (this.title === "$FAIL") {
    var x = null;
    x.fail();
}

if (this.title === "$TESTFAIL") {
    dpd.todos.post({title: "$FAIL"}, function(results, err) {
        this.results = results;
        this.err = err;
    });
}

if (this.title === "$REALTIME") {
    emit('createTodo', this);    
}

if (this.title === "$REALTIME2") {
    emit('createTodo2');    
}

onValidate:
if (this.message === 'notvalid') {
    error('message', "Message must not be notvalid");
}

if (this.title === 'notvalid') {
    error('title', "Title must not be notvalid");
}
